  \"2015-07-08T19:24:55.923127\",\n\t\"name\": \"arctic-water-vapor-characteristics-from-rawinsondes\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A gridded climatological monthly-mean data
  base of Arctic water vapor characteristics has been assembled by combining fixed
  station datanwith data from soundings taken over the Arctic Ocean from ships andnRussian
  drifting stations. Variables provided include temperature,nspecific humidity, zonal
  vapor flux, meridional vapor flux, zonal windnspeed, and meridional wind speed,
  available for 15 levels extendingnfrom the surface and then at every 50 mb from
  950 mb to 300 mb; seanlevel pressure and geopotential height, available at 850 mb,
  700 mb,n500 mb and 300 mb; and precipitable water, vertically integrated zonalnvapor
  flux and vertically integrated meridional vapor flux, availablenfor five layers,
  surface to 850 mb, 850 to 700 mb, 700 to 500 mb, 500nto 400 mb and 400 to 300 mb.
  Coverage of the rawinsonde archivesnextends from 1945 through 1990 for data from
  the Russian North Polenseries of drifting ice stations over the Arctic Ocean; from
  1976nthrough 1991 for fixed-station data obtained from the National Centernfor Atmospheric
  Research; and from about 1958 through 1991 fornfixed-station data obtained from
  the Historical Arctic RawinsondenArchive.n All variables were obtained through interpolation
  of the raw soundingndata, with the exception of sea level pressure and geopotentialnheight.
  The file, available via ftp, is structured in monthly datanarrays over a subsection
  of the National Meteorological Center gridn(octagonal grid format) centered over
  the pole, extending tonapproximately 65 degrees North on each side and about 55
  degrees Northnat the corners.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
